import React from 'react'
import './App.css';
import Header from './components/Header';
import Cards from './components/Cards';
import unionIcon from '../assets/icons/Union.png';

function App() {
  const pscard = [
    {
      title: 'High Prep',
      description: 'In-depth demonstrations and extensive proof-of-concept work requiring 4–10 weeks of preparation, with considerable resource investment.',
      buttonText: 'See PS',
      icon: unionIcon,
    },
    {
      title: 'Mid Prep',
      description: 'In-depth demonstrations and extensive proof-of-concept work requiring 4–10 weeks of preparation, with considerable resource investment.',
      buttonText: 'See PS',
    },
    {
      title: 'Low Prep',
      description: 'In-depth demonstrations and extensive proof-of-concept work requiring 4–10 weeks of preparation, with considerable resource investment.',
      buttonText: 'See PS',
    },
    {
      title: 'No Prep',
      description: 'In-depth demonstrations and extensive proof-of-concept work requiring 4–10 weeks of preparation, with considerable resource investment.',
      buttonText: 'See PS',
    },
  ]
  return (
    <div className="App">
      <Header/>
      <div className="cards-grid">
        {pscard.map((card,index) => (
          <Cards
          key={index}
          title = {card.title}
          icon = {card.icon}
          description = {card.description}
          buttonText = {card.buttonText}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
